    return (
        <ServiceOrderWrapper>
           <Title>Thông tin đặt lịch</Title>
           <Component>
           <SubTitle>Chọn Salon</SubTitle>
           <input type="text" id="fname" name="firstname" placeholder="Sơn móng tay"></input>
           Link
